import React, { Component } from 'react';

class Remote extends Component {
    constructor(props) {
        super(props);
        this.changeImage = this.changeImage.bind(this);
    }

    changeImage() {
        console.log(this.props.apiUrl+"/randomize-image");
        fetch(
            this.props.apiUrl + "/randomize-image", {
                credentials: "same-origin",
                method: "POST",
                body: {q: "sunset"}
            }
        ).then(response => {
            response.json().then(json => {
                console.log(json);
            });
        }).catch(function (error) {
            console.log(error);
        });
    }
    render() {
        return (
            <div>
                <h1>Remote</h1>
                <input placeholder="Search Images..." type="text"></input>
                <button onClick={this.changeImage}>Change Image</button>
                <button>0%</button>
                <button>50%</button>
                <button>100%</button>
            </div>
        )
    }
}

export default Remote;
